import './App.css';
import Inventario from './Pages/Inventario';
import { Component } from 'react';

import { Route } from 'react-router-dom';

class App extends Component {

  render() {
    return (
      <div>
        <Routes>
        <Route path="/" element={<Inventario />}></Route>
        </Routes>

      </div>
    );
  }
}

export default App;
